function fetchData() {
  fetch('http://localhost:3000/api/v1/jobs')
  .then(response => {
    if (!response.ok) {
      throw Error('An error occurred. Please try again.')
    }
    return response.json()
  }).then(data => {
    console.log(data.shift);
  }).catch(error => {
    console.log(error)
  });
}

fetchData()
